Category	All Girl, Girl-Girl, Lesbian

Director	Sal Genoa
Starring	Dana DeArmond, Anikka Albrite, Carter Cruise, Sara Luvv, Marina Angel, Catie Parker

A group of beyond beautiful 'good girls' gets a chance to have a beautiful summer vacation. What happens next is beyond your wildest imagination! A group of gorgeous 'evil girls' are running though town on a destructive path. The unthinkable could just happen. Could this be a happy ending...or a twisted fate?

